        <>
        <div className = 'card'>
            <div className = 'card-body'>
                <h1 className ='card-body-name'>{title}</h1>
                <p className ='description'>{description}</p>
            </div>


            <div className= 'content'>

            </div>

        </div>


        </>


);

export default withRouter(Project);
